import React from "react";

function Product(props){
    const {name,descripcion,price,sku,amount} = props;
    return(
        <div>
            <p>{name}</p>
            <p>{descripcion}</p>
            <p>$ {price}</p>
            <p>{sku}</p>
            <p>{amount}</p>
        </div>
    )
}
export default Product
